import {search} from 'react-icons-kit/feather/search';
import Radium from 'radium';

const pastille = () => {
    return (
        <div className={classes.pastille}>
            <div className={classes.pastilleLeft}>
                <Icon style={{marginTop: '50px'}} icon={list} size={60} className={classes.iconLeft}/>
                <p className={classes.paragraphe}>Th√®mes</p>
            </div>
            <div className={classes.pastilleRight}>
                <Icon style={{marginTop: '50px'}} icon={search} size={60} className={classes.iconRight}/>
                <p className={classes.paragraphe}>Recherche</p>
            </div>    
        </div>
    );
}

export default Radium(pastille);
